import React, { useState, useEffect } from 'react'
import { Link } from 'react-router-dom';


const Order = () => {
    const user_id = localStorage.getItem('id');
    const [data, setdata] = useState([]);
    const [found, setfound] = useState(false)

    // const [room, setRoom] = useState([]);
    useEffect(() => {
        getorder();
    }, [])

    const getorder = async () => {
        let response = await fetch(`http://localhost:8080/api/order/${user_id}`);
        let res = await response.json();

        if(res.success){
            let result = JSON.parse(res.message.order)
            setdata(result);
            if(result.length > 0){
                setfound(true);
            }
        }else{
            console.log('something went wrong!')
        }



    }


    return (
        <div className='container-fluid'>
            {found ? (
                <div className='wrap_table'>
                    <h1 align="center">Current Order</h1>
                    <table className='table table-bordered mt-5'>
                        <thead>
                            <tr>
                                <th>Image</th>
                                <th>Order Id</th>
                                <th>Title</th>
                                <th>Price</th>
                                <th>Financial_Status</th>
                                <th>Fulfillment_Status</th>
                                <th>Shipping_Address</th>

                            </tr>
                        </thead>
                        <tbody>

                            {data && data.map((value, index) => {
                            let line_item = value.line_items;
                            let shipping = value.shipping_address;  

                                return (
                                    <tr key={index}>
                                        <td>{value.id}</td>
                                        {line_item.map((item,key)=>{
                                            return(
                                                <>
                                                <td><img src={item.image} width="150" /></td>
                                                <td>{item.title}</td>
                                                </>
                                            )

                                        })

                                       }
                                        <td>{value.total_price}</td>
                                        <td>{value.financial_status}</td>
                                        <td>{value.fulfillment_status}</td>
                                        <td>
                                        <ul>
                                            {shipping.map((val,i)=>{

                                                return (
                                                    <>
                                                 <li>{val.name}</li>
                                                 <li>{val.address}</li>       
                                                 <li>{val.phone}</li>       
                                                 <li>{val.city}</li>
                                                 <li>{val.city}</li>    
                                                 <li>{val.zip}</li> 
                                                 <li>{val.state}</li>
                                                 <li>{val.country}</li>      
                                                </>    


                                                )
                                            })}
                                            </ul>
                                        </td>


                                    </tr>
                                )


                            })}


                        </tbody>
                    </table>
                </div>
            ) : (
                <div className='wrap_empty text-center'>
                    <h3>Currently, There are no any Order</h3>
                    <Link to='/profile'>Browse Products</Link>
                </div>
            )
            }
        </div>
    )
}

export default Order
